import React, { useState, useEffect } from "react";


function Cart() {
    const [carts, setCarts] = useState([]);
    const [error, setError] = useState(null); //eslint-disable-line

    useEffect(() => {
        fetchCarts();
    },[]);

    const fetchCarts = () => {
        fetch('https://fakestoreapi.com/carts')
        .then(res => res.json())
        .then(data => {
            console.log(data)
            setCarts(data);
        })
        .catch(error=>{
            console.error('Error fetching carts:', error);
            setError('Failed to fetch carts. Please try again later.');
        });
    }
    const updateCart = () => {
        fetchCarts();
    }
    console.log(carts)

    return (
        <div>
            <h1>Cart</h1>
            <div>
                {carts.map((cart, index) => (
                    <div key={index}>
                        <h2>Cart ID: {cart.id}</h2>
                        <p>User ID: {cart.userId}</p>
                        <p>Date: {cart.date}</p>
                        <ul>
                            {cart.products.map((product, productIndex) => (
                                <li key={productIndex}>
                                    <p>Product ID: {product.productId}, Quantity: {product.quantity}</p>
                                </li>
                            ))}
                        </ul>
                    </div>
                ))}
            </div>
        </div>
    )
}
export default Cart;
